import React from 'react';
import ReactDOM from 'react-dom';

class Logo extends React.Component {

    render() {

        return (
         <nav class="nav-bar">
           <a href="#"> Home</a>
           <a href="#"> Login</a>
           <a href="#"> Sign-up</a>
           <a href="#"> About</a>
           <a href="#"> Github</a>
         </nav>
        );
      }


  }

  ReactDOM.render(<Logo/>, document.getElementById("navbar"));
